import axios from "axios"

export const getDataFromSnkrDunk = async (code, size) => {
    const response = await axios.get(`https://snkrdunk.com/v1/sneakers/${code}/size/list`)
    const data = response.data.data.minPriceOfSizeList.map(
        item => {
            return {
                size: item.size,
                price: item.price
            }
        }
    )
    return data
}
